import React from 'react'
import Dashboard from '../dashboard'

export default function Profile() {
    return (
        <Dashboard style={{display:'flex', justifyContent: 'center', 
        alignItems:'center', height: '90vh'}}>
            <h1>Profile Page</h1>
        </Dashboard>
    )
}
